import React from "react";
import { Link } from "react-router-dom";
import ReactPlayer from "react-player";
import quizOneBackground from "../visuals/quiz/q1_background.mp4";
import candle from "../images/quiz/q2/candle.png";
import getaway from "../images/quiz/q2/getaway.png";
import mirror from "../images/quiz/q2/mirror.png";

export default function questionTwo() {
  return (
    <div className="questionContainer">
      <ReactPlayer
        className="react-player quiz-video"
        url={quizOneBackground}
        width="100%"
        height="100%"
        controls={false}
        loop={true}
        playing={true}
      />
      <div className="content">
        <h1>What is your goal with today's treatment?</h1>
        <div className="door-container ">
          <div className="door doorOne">
          <img src={getaway} alt="" />

          </div>
          <div className="door doorTwo">
           <img src={mirror} alt="" />
          </div>
          <div className="door doorThree">
          <img src={candle} alt="" />

          </div>
        </div>
        <Link to="/question-three">Room three</Link>
      </div>
    </div>
  );
}
